<!DOCTYPE html>
<meta charset="utf-8">
<style>

    .node {
        font: 10px sans-serif;
    }

    .link {
        stroke: steelblue;
        stroke-opacity: .4;
        fill: none;
    }

</style>
<body onload="draw()">
<div id="graph"></div>
<script src="//d3js.org/d3.v5.min.js"></script>
<script>
    function draw() {
        const line = d3.lineRadial()
            .curve(d3.curveBundle.beta(0.85))
            .radius(d => d.y)
            .angle(d => d.x);

        const width = 720;

        const radius = width / 2;
        const tree = d3.cluster()
            .size([2 * Math.PI, radius - 100]);

        const colornone = "#ccc";
        const colorout = "#f00";
        const colorin = "#00f";

        function id(node) {
            return `${node.parent ? id(node.parent) + "#" : ""}${node.data.file}`;
        }

        function bilink(root) {
            let leaves = root.leaves();
            const map = new Map(leaves.map(d => [id(d), d]));
            for (const d of root.leaves()) d.incoming = [], d.outgoing = d.data.coupled.map(i => [d, map.get("com" + "#" + i.file)]).filter(c => c[1] !== undefined);
            for (const d of root.leaves()) for (const o of d.outgoing) o[1].incoming.push(o);
            return root;
        }

        function hierarchy(data, delimiter = "#") {
            let root;
            const map = new Map;
            data.forEach(function find(data) {
                const {file} = data;
                if (map.has(file)) return map.get(file);
                const i = file.lastIndexOf(delimiter);
                map.set(file, data);
                if (i >= 0) {
                    find({file: file.substring(0, i), children: []}).children.push(data);
                    data.file = file.substring(i + 1);
                } else {
                    root = data;
                }
                return data;
            });
            return root;
        }

        classes.forEach(d => d.file = "com#" + d.file);

        const data = hierarchy(classes);

        const root = tree(bilink(d3.hierarchy(data)
            .sort((a, b) => d3.ascending(a.height, b.height) || d3.ascending(a.data.file, b.data.file))));

        const svg = d3.select("#graph").append("svg")
            .attr("viewBox", [-width / 2, -width / 2, width, width]);

        svg.append("g")
            .attr("font-family", "sans-serif")
            .attr("font-size", 10)
            .selectAll("g")
            .data(root.leaves())
            .join("g")
            .attr("transform", d => `rotate(${d.x * 180 / Math.PI - 90}) translate(${d.y},0)`)
            .append("text")
            .attr("dy", "0.31em")
            .attr("x", d => d.x < Math.PI ? 6 : -6)
            .attr("text-anchor", d => d.x < Math.PI ? "start" : "end")
            .attr("transform", d => d.x >= Math.PI ? "rotate(180)" : null)
            .text(d => d.data.file)
            .each(function (d) {
                d.text = this;
            })
            .on("mouseover", overed)
            .on("mouseout", outed)
            .call(text => text.append("title").text(d => `${id(d)} ${d.outgoing.length} outgoing ${d.incoming.length} incoming`));

        const link = svg.append("g")
            .attr("stroke", colornone)
            .attr("fill", "none")
            .selectAll("path")
            .data(root.leaves().flatMap(leaf => leaf.outgoing))
            .join("path")
            .style("mix-blend-mode", "multiply")
            .attr("d", ([i, o]) => line(i.path(o)))
            .each(function (d) {
                d.path = this;
            });

        function overed(d) {
            link.style("mix-blend-mode", null);
            d3.select(this).attr("font-weight", "bold");
            d3.selectAll(d.incoming.map(d => d.path)).attr("stroke", colorin).raise();
            d3.selectAll(d.incoming.map(([d]) => d.text)).attr("fill", colorin).attr("font-weight", "bold");
            d3.selectAll(d.outgoing.map(d => d.path)).attr("stroke", colorout).raise();
            d3.selectAll(d.outgoing.map(([, d]) => d.text)).attr("fill", colorout).attr("font-weight", "bold");
        }

        function outed(d) {
            link.style("mix-blend-mode", "multiply");
            d3.select(this).attr("font-weight", null);
            d3.selectAll(d.incoming.map(d => d.path)).attr("stroke", null);
            d3.selectAll(d.incoming.map(([d]) => d.text)).attr("fill", null).attr("font-weight", null);
            d3.selectAll(d.outgoing.map(d => d.path)).attr("stroke", null);
            d3.selectAll(d.outgoing.map(([, d]) => d.text)).attr("fill", null).attr("font-weight", null);
        }
    }


</script>
